018-02','2018-09-12 22:55:45','2018-09-12 22:55:45','','',NULL),(47,'120180232','东亚史与历史学',2,'','100','课程','大教室','2018-09-03','2019-01-15','t/','19:30:00','21:30:00',20,'9201502803',NULL,'2018-02','2018-09-12 22:56:44','2018-09-12 22:56:44','','{\"path\":\"/pioneer/document/courseInfo/5/6/2dba4c2a-2164-4933-9330-8f27928e8d69.docx\",\"size\":710464,\"name\":\"东亚史与历史学-布彦隆之.docx\",\"type\":\"docx\"}',NULL),(48,'120180245','生活美学',2,'','100','课程','小教室','2018-09-03','2019-01-15','f/','10:00:00','12:00:00',20,'9201502803',NULL,'2018-02','2018-09-12 22:58:53','2018-09-12 22:58:53','','{\"path\":\"/pioneer/document/courseInfo/1/9/fbaa23e9-b016-4057-baac-84f4a7d9cd47.docx\",\"size\":710317,\"name\":\"生活美学-布彦隆之.docx\",\"type\":\"docx\"}',NULL),(49,'120180290','游戏艺术',2,'','100','课程','小教室','2018-09-03','2019-01-15','t/','10:00:00','12:00:00',20,'9201502803',NULL,'2018-02','2018-09-12 22:59:44','2018-09-12 22:59:44','','{\"path\":\"/pioneer/document/courseInfo/9/9/657fc238-0c75-4a5f-bf05-b34c0793ef50.docx\",\"size\":710183,\"name\":\"游戏艺术-布彦隆之.docx\",\"type\":\"docx\"}',NULL),(50,'120180212','英语预约课',2,'','100','预约课程','','2018-09-03','2019-01-15','','','',20,'9201801590',NULL,'2018-02','2018-09-13 00:03:23','2018-09-13 00:03:23','','',NULL),(51,'120180258','计算机预约课',2,'','100','预约课程','','2018-09-03','2019-01-15','','','',20,'9201801590',NULL,'2018-02','2018-09-13 00:03:32','2018-09-13 00:03:32','','',NULL),(53,'120180261','布彦隆之-导师课',0,'','100','预约课程','','2018-09-03','2019-01-15','','','',20,'9201502803',NULL,'2018-02','2018-09-13 01:23:30','2018-09-13 01:23:30','','',NULL),(54,'120180236','阅读课',2,'','100','课程','小教室','2018-09-03','2019-01-01','','','',20,'9201501154',NULL,'2018-02','2018-09-15 13:14:11','2018-09-15 13:14:11','','',NULL),(55,'120180211','魔兽世界',3,'','100','项目','','2018-09-03','2019-01-15','w/','aN:aN:aN','aN:aN:aN',20,'9201402713',NULL,'2018-02','2018-09-23 23:26:54','2018-09-25 13:08:19','','',NULL),(56,'120180215','笑谈广东话',2,'','100','项目','','2018-09-03','2019-01-15',