/*Table structure for table `feedback` */

DROP TABLE IF EXISTS `feedback`;

CREATE TABLE `feedback` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `comment` longtext DEFAULT NULL,
  `faculty_id` varchar(255) DEFAULT NULL,
  `info` varchar(255) DEFAULT NULL,
  `operator_id` varchar(255) DEFAULT NULL,
  `rate` longtext DEFAULT NULL,
  `self_comment` longtext DEFAULT NULL,
  `update_time` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;

/*Data for the table `feedback` */

insert  into `feedback`(`id`,`comment`,`faculty_id`,`info`,`operator_id`,`rate`,`self_comment`,`update_time`) values (1,NULL,'9201801826','2019','9201801590','[{\"star\":4.5,\"comment\":\"啊手动阀手动阀手动阀\"}]','基本完成本职工作，作为寝室老师能够认识所有同学并且有所交流，能够与其中部分同学深入交流，了解他们的需求和问题；在出纳岗位方面，完成学校账款支付、收据和发票的开具等工作；行政岗位方面，完成每月餐费领取及使用工作，学校部分物资采购和保管工作等；作为助教，课程出勤率较高，协助部分导师和兼职老师进行教学活动等。\n工作积极性有所不足，工作比较被动不擅长发现问题。','2019-01-26 23:46:06'),(2,NULL,'9201402713','2019','9201402713',NULL,'总体星级：4星\n\n导师工作（4星）：\n\n优：\n18年上半年，对李双成和许毅晗两人有效的支持和沟通。支持李双成理解自身的问题，接纳规则调整自己与他人的相处关系。支持许毅晗探索游戏，从比较防备的状态到逐渐打开分享过去的经历。\n\n18年下半年，带领的6位学生可以保证每月最少有三小时以上的沟通，根据不同学生的状态会花更多和较少的时间。在支持谭行知、刘霈臻、王涵的成长上卓有成效，也能够做到对高瑞泽、彭稚钦、许毅晗的全面了解。\n\n劣：\n作为导师也应该去理解和了解更多学生。但当其他学生和我自己带领的学生发生分歧时不能很好的理解对方。\n\n寝室工作（4星）：\n\n能做到对寝室学生比较全面的了解，并和每个学生保持一定的沟通频率。（每月至少一次单独沟通）支持寝室自制和聚餐卓有成效。\n\n问题在于寝室有一个学生，一个学期没有和导师沟通过一次，但没有及时了解并反馈给导师。\n\n外事工作（4.9星）：\n\n可以将外事做成教学的一部分，稳定支持校外人士了解学校并支持新生。而且补位了很多家长沟通的工作。\n\n教务工作（3星）：\n\n18年上半年兼职负责了部分教务工作，对讲授式课程有自己不认同和不理解的部分，并对此类课程产生偏见。而在处理教务相关问题上，容易将偏见带进工作中。并在这个过程中和部分老师产生相处上的问题。在树立教务规则等方面稳步推进。总体4星，但造成这样的问题扣1星。因此3星。\n\n金刚工作（4.5星）：\n\n起草了较多的制度文件，并给其他老师做了较多的部位工作。可主动发现学校管理层面的问题并通过与老师沟通合力解决问题。\n\n成都行会、创新教育交流会（4星）：\n\n推进19年初联欢会活动，推进18年中旬北京交流会年会。让学校与同行的关系更紧密，持续与同行建立联系，发生影响。','2019-01-25 14:11:56'),(3,NULL,'9201801110','2019','9201801110',NULL,'2018年度我在会计核算和财务预算上除了日常的费用报销、支付款项、报税和学期初的预算汇总等工作外，还利用网络资源启用了“柠檬云”财务软件（免费网络版），方便、准确又快捷地完成会计核算工作；也利用网络资源启用了“云快报”费用报销软件（免费网络版），在一定程度上使费用申请、报销和借款等日常支付款项工作跨时空完成，各环节可视化；申请使用了电子发票，减少税务工作上的人力成本和时间成本。在财务专业上，我取得了美国管理会计师证书（CMA中文版），在以后的工作和学习中还需要不断更新知识、拓展视野和有效实践。\n2018年对我是不平凡的一年，许多人事在不经意间发生又消失，正所谓“麻雀虽小五脏俱全”，既认识自己的有限，也去发现自己的潜能，做好本份竭力帮人。\n','2019-01-24 22:27:34'),(4,'null/9201801826','9201801590','2019','9201801590',NULL,'总评4星⭐⭐⭐⭐\n导师工作：4星\n从加入先锋的一年以来，辅导学生的人数从2人增长到了10人，每月也保证和学生有至少3小时的沟通时间。其中和小鱼，子祺等学生，有过一对一的长聊，也及时跟进学生的心理、健康情况。\n教务工作：4星\n从6月初接手教务工作以来，我快速熟悉业务，开始的时候也有过一些急躁。我觉得本年我对教务工作从入门到熟悉，了解各个老师的需求，但在项目跟进和一些预算处理上还稍显不足。\n软件工作：4星\nPCP基础开发工作基本完成。完成了监控设备的拆装，官网1期的开发等，都有不错的反馈。','2019-01-26 23:46:06'),(5,NULL,'9201501154','2019','9201701000',NULL,NULL,'2019-01-24 13:58:03'),(6,NULL,'9201502803','2019','9201502803',NULL,'总括：\n这是我加入先锋以来，工作最累的一个学年，也是教学成绩最好的一个学年。体现在几个方面，学生数量；学生实际情况；课程数量；社会传播等。我把自己的工作成绩每个方面以★来进行标示，5★为满。\n\n陪伴：★★★★★\n这是先锋的教育重点，一是我的学生多，二是学生里面新生多；三是学生情况复杂，比如性格层面存在各种问题多学生尤为多，差不多我的日常休息时间基本全部被占用，但是对于学生的改善和成长以及后续的人生规划价值也是显而易见的。\n\n课程：★★★★★\n这是我对学生进行“学会思考”和“学会学习”两个方面的教育重点，本学期我有四门课，除去进行国际化的前沿学术观点传递外，更加注重对于新学生思考能力的培养，希望他们可以在第1个学期开一扇思考力的天窗；第2个学期找到研究的兴趣；第3个学期进行真正的独立研究并产生价值；第4个学期成为我真正意义上的教学助手。\n\n传播：★★★★\n这个学年，因为前两个部分占用了我几乎所有时间，所以再传播工作上我更多利用休息日以“先锋导师&独立学者”的身份进行大量社会活动和讲座，对我校进行教育理念和成绩进行宣讲和推广。秋季学期随着左众的加入，我开始和左众/石磊进行微信公众号/网站进行整改，对架构/内容尤其是影视素材进行了大量拍摄，目前传播素材库已经基本就绪。\n\n项目/预约课：★★★★\n这个学年，我先后有两个和一个项目小组，其中游戏研究室作为游戏文化的专题探讨项目，已经培养出韩秋实/党建桐/安芮琪/何子宸/谢天悦等一批从随便打打游戏，到研究游戏背景再到社会性的文化思考的学生。预约课方面，谢天悦同学的游戏课/历史课，庞雨琳同学的历史课，都达到了“精致化教学一对一”的新高度，一是因为学生生源质量高，二是我们的授课方式具有非常强的学术性，这些都使得预约课成为了一种新的有效的教学方式。\n','2019-01-25 10:38:10'),(7,NULL,'9201503542','2019','9201503542',NULL,'回顾2018年年度工作，在做事和同事沟通方面，比较缺乏主动性及看待事的全面性，根据以下工作，整体评星为★★★★\n2018年上学期，主要负责小学部。小学部从前期的筹备到学期结束，工作内容主要包含行政后勤、教务工作、对外接待及少部分家长沟通工作，整个学期也是一波三折，会因经验不足部分事的处理方式不足，幸而在老师们的支持下完成小学部的学期工作。\n2018年下学期因小学部校址问题，故工作重心转回中学部，工作内容主要分为行政后勤、人事、寝室管理、学生项目四个方面。1、行政后勤的工作比较繁琐，含盖了食堂、寝室、学习中心的日杂事等，在日常的管理中能意识到其中的问题所在，求助其他老师加以修正；2、人事方面工作量不大，主要做一些基础沟通及员工合同的工作，因自身缺乏相关经验，目前在学习中；3、寝室管理主要负责女生寝室及1402的查寝工作，女生寝室工作主要是规则建立、家长沟通及寝室矛盾3方面。女生们性格差异大，日常相处下摩擦不断，前期主要花时间处理周佳韵和林芝欣的矛盾，在这个过程中支持并协助她们互相面对面的沟通，试着说出各自的需求，如何在中间取相处的平衡点。后期稍微熟悉后，女生们发生矛盾时主要支持她们自己去解决问题；4、学生项目是协助小虞做“虞嬷嬷的小冰箱”，整个项目能看到小虞的不确定性和事先的预判性，所以整个过程我是偏主动的推着他做，后期能明显感觉到他在项目过程中找到自信后的积极性，并且他自己能在整个项目过程中有思考和反思。','2019-01-26 23:28:50');

